import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{ //fonksiyonelliğini genişlet ve app'i class component sayesinde
  constructor(){ // p değişse buttona basılsa da bu constructor kurucu yöntem çalıştırsın
    super()
    this.state = {
      name: "Akın",
    }
  } 
  render(){  
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>Selam {this.state.name} </p>
        <button onClick={()=>{
          this.state.name = "Namık"
          console.log(this.state)
        }}> İsmi Değiştir</button>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}
}

export default App;
